import React from "react";

export default function Nav(props) {
  return (
    <>
      <div className="">
        <div className="flex flex-row justify-between space-x-8 bg-slate-300 ">
          <div className="logo">{props.kk}</div>
          <div className="about">about</div>
        </div>

      </div>

      <section className="mx-auto">
        
        <textarea name="ak" id="p1" cols="30" rows="10" className="text-red-200 w-11/12 mx outline-2 outline-red-300 border-2 border-red-900"></textarea>

      </section>
      <h1>dfd</h1>
    </>
  );
}
